import logo from './logo.svg';
import styled from 'styled-components'

function App() {
  return (
    <div className="App">
      <Wrapper>
<FirstColumn />
<SecondColumn />
      </Wrapper>
    </div>
  );
}

const Wrapper = styled.div`
  display: flex;
`

const FirstColumn = styled.div`
flex: 5;
max-width: 41.66%;
width: 41.66%;
`

const SecondColumn = styled.div`
flex: 7;
max-width: 58.33%;
width: 58.33%;
`


export default App;
